import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import styles from './RequestDetail.module.css';
import axios from 'axios';

const RequestDetail = () => {
  const { requestId } = useParams();
  const navigate = useNavigate();
  const [request, setRequest] = useState(null);
  const [blockAdmin, setBlockAdmin] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios
      .get(`http://localhost:8080/requests/${requestId}`)
      .then((response) => {
        const req = response.data;
        setRequest(req);
        const block = req.block;
        
        // Fetch admin for that block
        axios
          .get(`http://localhost:8080/users/block/${block}`)
          .then((adminResponse) => {
            const adminList = adminResponse.data;
            if (adminList.length > 0) {
              setBlockAdmin(adminList[0]); // take first admin from list
            }
            setLoading(false);
          })
          .catch((err) => {
            console.error('Error fetching admin:', err);
            setError('Failed to load admin');
            setLoading(false);
          });
      })
      .catch((err) => {
        console.error('Error fetching request:', err);
        setError('Failed to load request');
        setLoading(false);
      });
  }, [requestId]);

  const goBack = () => {
    navigate(-1);
  };

  if (loading) {
    return <div className={styles.loading}>Loading...</div>;
  }

  if (error) {
    return <div className={styles.error}>{error}</div>;
  }

  return (
    <div className={styles.detailContainer}>
      <h2 className={styles.title}>Request Details</h2>
      <div className={styles.requestDetails}>
        <p><strong>Service:</strong> {request.service}</p>
        <p><strong>Block:</strong> {request.block}</p>
        <p><strong>Flat Number:</strong> {request.flatNo}</p>
        <p><strong>Description:</strong> {request.description}</p>
        <p><strong>Status:</strong> {request.status}</p>
        <p><strong>Requested Date:</strong> {request.requestedDate}</p>
        <p><strong>Updated Date:</strong> {request.updatedDate}</p>
      </div>

      {blockAdmin && (
        <div className={styles.adminDetails}>
          <h3>Assigned Block Admin</h3>
          <p><strong>Name:</strong> {blockAdmin.name}</p>
          <p><strong>Email:</strong> <a href={`mailto:${blockAdmin.email}`}>{blockAdmin.email}</a></p>
          <p><strong>Phone:</strong> <a href={`tel:${blockAdmin.mobileNo}`}>{blockAdmin.mobileNo}</a></p>
        </div>
      )}

      <button onClick={goBack} className={styles.backButton}>
        Back
      </button>
    </div>
  );
};

export default RequestDetail;
